import Link from 'next/link';

const linkStyle = {
  marginRight: 20
};
const logoStyle = {
  marginLeft: 17,
  width: '10%'
};
const Header = () => (
  <div>
    <img style={logoStyle} src="../static/logo.png"/>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/amazon">
      <a style={linkStyle}>Amazon</a>
    </Link>
  </div>

);

export default Header;
